import React from 'react';

import Layout from '../component/layout';

function Privacy() {
  return (
    <Layout>
      <div>
        <h1>個人情報の利用目的について</h1>
        <p>当ブログでは、お問い合わせやコメント投稿の際に氏名・メールアドレス等の個人情報を入力いただく場合があります。
            取得した個人情報は、必要な連絡のみに利用させていただくもので、これらの目的以外では利用いたしません。
        </p>
      </div>
    </Layout>
  );
}

export default Privacy;
